INSERT INTO `exam` VALUES ('QUES001','From what location are the 1st computer instructions available on boot up?','ROM BIOS','CPU','boot.ini','CONFIG.SYS','ROM BIOS'),('QUES002','What could cause a fixed disk error','No-CD installed','bad ram','slow processor','Incorrect CMOS settings','Incorrect CMOS settings'),('QUES003','Missing slot covers on a computer can cause?','over heat','power surges','EMI','incomplete path for ESD','over heat'),('QUES004','When installing PCI NICS you can check the IRQ availability by looking at','dip switches','CONFIG.SYS','jumper settings','motherboard BIOS','motherboard BIOS'),('QUES005','With respect to a network interface card, the term 10/100 refers to','protocol speed','a fiber speed','megabits per seconds','minimum and maximum server speed','megabits per seconds'),('QUES006','Which Motherboard form factor uses one 20 pin connector','ATX','AT','BABY AT','All of the above','ATX'),('QUES007','A hard disk is divided into tracks which are further subdivided into','clusters','sectors','vectors','heads','sectors'),('QUES008','A wrist grounding strap contains which of the following','Surge protector','Capacitor','Voltmeter','Resistor','Resistor'),('QUES009','Which standard govern parallel communications?','RS232','RS-232a','CAT 5','IEEE 1284','IEEE 1284'),('QUES010','In laser printer technology, what happens during the conditioning stage?','The corona wire places a uniform positive charge on the paper','A uniform negative charge is placed on the photosensitive drum','A uniform negative charge is placed on the toner','All of the above','A uniform negative charge is placed on the photosensitive drum'),('QUES011','What product is used to clean smudged keys on a keyboard?','TMC solvent','Silicone spray','Denatured alcohol','All-purpose cleaner','All-purpose cleaner'),('QUES012','ESD would cause the most damage to which component?','Power supply','Expansion board','Monitor','Keyboard','Expansion board'),('QUES013','To view any currently running Terminate Stay Resident (TSR\'s) programs you could type','Memory','MEM','SYS /M','Memmaker','MEM'),('QUES014','Which type of system board is the MOST likely candidate for processor upgrading if you want maximum performance and future compatibility?','ML','PCI','ISA','EISA','PCI'),('QUES015','Suppose that you have a the maintenance package identifies several possible field replaceable units (FRUs) that will resolve the problem. What should you do after turning the power off?','Replace the indicated parts, one at a time in the recommended sequence, until the problem is resolved; return unused FRUs to stock','Replace all of the indicated FRUs at once and return the machine to the customer if the problem is resolved','Follow the same procedure as in ays replace the system board first if it is on the list of possible FRUs If multiple FRUs are indicated, then software is the most likely source of the problem','None of the above','Replace the indicated parts, one at a time in the recommended sequence, until the problem is resolved; return unused FRUs to stock'),('QUES016','Most PCs give a single beep on bootup to indicate they are ok hardware wise. You boot your PC and don\'t get a beep. What should you check first?','system board','RAM','microprocessor','speaker','speaker'),('QUES017','Which peripheral port provides the FASTEST throughput to laser printers?','RS-232','SCSI','Parallel','Serial','Parallel'),('QUES018','The mouse pointer moves erratically, what is the possible cause? The mouse','ball is dirty','is not connected','driver is not installed properly','has an incorrect IRQ setting','ball is dirty'),('QUES019','Voltage is measured','in parallel','in series','after breaking the circuit','after checking resistance','in parallel'),('QUES020','Your customer tells you the print quality of their dot matrix printer is light then dark. Which of the following could cause the problem','Paper slippage','Improper ribbon advancement','Paper thickness','Head position','Improper ribbon advancement'),('QUES021','The 34-pin connection on an I/O card is for?','Floppy drive','SCSI drive','IDE drive','Zip drive','Floppy drive'),('QUES022','What beep codes could indicate a system board or power supply failure?','steady short beep','no beep','one long continuous beep tone','All of the above','All of the above'),('QUES023','After doing a low-level format, what would be the next step in configuring the hard drive in a system?','Format DOS partition','Install operating system','Configure DMA channel and back-up interrupt','Partition had disk','Format DOS partition'),('QUES024','Resistance is measured in ?','Volts','Amps','Watts','Ohms','Ohms'),('QUES025','When installing a SCSI CD-ROM drive, you must set the CD-ROM SCSI adapter to','B0007','An unused SCSI address','The same address as the SCSI device before the CD-ROM','SCSI ID=1','An unused SCSI address'),('QUES026','Pick the correct choice for the 80386SXCPU','16 bit word size, 16 bit data path','32 bit word size, 16 bit data path','8 bit word size, 32 bit data path','32 bit word size, 8 bit data path','32 bit word size, 16 bit data path'),('QUES027','In Inkjet technology the droplets of ink are deflected by?','multi directional nozzles','electronically charged plates','high pressure plates','electro static absorbtion','multi directional nozzles'),('QUES028','What tool is used to test serial and parallel ports?','high volt probe','cable scanner','loop backs (wrap plugs)','sniffer','loop backs (wrap plugs)'),('QUES029','What voltage does a Pentium system use?','+12 volts','+ 5 volts','+ 8 volts','+3.3 volts','+3.3 volts'),('QUES030','A numeric error code check: A 17xx indicates a problem with:','CMOS','ROM BIOS','DMA controller','hard drive or controller','hard drive or controller'),('QUES031','Which provides the fastest access to large video files?','Optical drives','IDE hard drives','SCSI hard drives','EIDE hard drives','SCSI hard drives'),('QUES032','A 25-pin female connector on the back of 