ended memory','Uses expanded memory on a 80386 processor','Supports code page switching','Manages the use of extended memory'),('QUES041','The digital multimeter is set for DC, Ohm and 20k. You will read _____ while measuring a good 2 amp fuse.','0.00','0.02','0.20','2.00','0.00'),('QUES042','An anti static strap uses a small _____ to make sure you do not become the least path of resistance to the ground?','capacitor','diode','transistor','resistor','resistor'),('QUES043','If the memory slots have 30 pins then the chip is a?','DIMM','SIMM','SDRAM','All of the above','SIMM'),('QUES044','Which values are held in CMOS for the hard drive','size (heads, cylinders, sectors)','IRQ','Free space','Virus alert','size (heads, cylinders, sectors)'),('QUES045','What device prevents power interruptions, resulting in corrupted data?','Battery back-up unit','Surge protector','Multiple SIMMs strips','Data guard system','Battery back-up unit'),('QUES046','In a computer with an eide adapter, where should you connect an ATA CD-ROM drive?','on the floppy bus','on the primary IDE','on the secondary IDE','on the SCSI bus','on the secondary IDE'),('QUES047','What\'s the best way to prevent damaging your PC with static electricity?','place your PC on a rubber mat','wear leather soled shoes','periodically touch a safe ground point on the PC to discharge yourself','wear an ESD wrist strap','wear an ESD wrist strap'),('QUES048','Which would you do first when troubleshooting a faulty monitor?','Check its connections to the computer and power source','Use a meter to check the CRT and internal circuitry for continuity','Power down the monitor, then turn it on again to see if that corrects the problem','Power down the computer, then turn it on again to see if that corrects the problem','Check its connections to the computer and power source'),('QUES049','To install a second IDE drive into a computer, you must','Set the master-slave jumper to slave on the second drive','Use the IDE configuration software to set the new drive as slave','Verify that you define the new drive as D: in the CMOS setup','Verify that you attach the drive to the connector at the end of the ribbon cable','Set the master-slave jumper to slave on the second drive'),('QUES050','Why does a successfully mapped network drive disappear every time you boot the computer?','The computer you are connected to has moved','You didn\'t click reconnect on log on','The map statement is not in the autoexec.bat file','The last drive was not set correctly','The map statement is not in the autoexec.bat file'),('QUES051','Which bus is bidirectional?','data bus','control bus','address bus','multiplexed bus','data bus'),('QUES052','The software used to drive microprocessor-based systems is called:','assembly language programs','firmware','BASIC interpreter instructions','flowchart instructions','assembly language programs'),('QUES053','A microprocessor unit, a memory unit, and an input/output unit form a:','CPU','compiler','microcomputer','ALU','microcomputer'),('QUES054','The technique of assigning a memory address to each I/O device in the SAM system is called:','wired I/O','I/O mapping','dedicated I/O','memory-mapped I/O','memory-mapped I/O'),('QUES055','Which of the following is not a basic element within the microprocessor?','microcontroller','arithmetic-logic unit (ALU)','temporary register','accumulator','microcontroller'),('QUES056','The output will be a LOW for any case when one or more inputs are zero in a(n):','OR gate','NOT gate','AND gate','NAND gate','AND gate'),('QUES057','If a signal passing through a gate is inhibited by sending a low into one of the inputs, and the output is HIGH, the gate is a(n):','AND','NAND','NOR','OR','NAND'),('QUES058','A single transistor can be used to build which of the following digital logic gates?','AND gates','OR gates','NOT gates','NAND gates','NOT gates'),('QUES059','Sample-and-hold circuits in ADCs are designed to:','sample and hold the output of the binary counter during the conversion process','stabilize the ADCs threshold voltage during the conversion process','stabilize the input analog signal during the conversion process','sample and hold the ADC staircase waveform during the conversion process','stabilize the input analog signal during the conversion process'),('QUES060','Convert the decimal number 151.75 to binary.','10000111.11','11010011.01','00111100.00','10010111.11','10010111.11'),('QUES061','How many digits of the DNIC (Data Network Identification Code) identify the country?','first three','first four','first five','first six','first three'),('QUES062','A station in a network forwards incoming packets by placing them on its shortest output queue. What routing algorithm is being used?','hot potato routing','flooding','static routing','delta routing','hot potato routing'),('QUES063','The probability that a single bit will be in error on a typical public telephone line using 4800 bps modem is 10 to the power -3. If no error detection mechanism is used, the residual error rate for a communication line using 9-bit frames is approximately equal to','0.003','0.009','0.991','0.999','0.009'),('QUES064','Frames from one LAN can be transmitted to another LAN via the device','Router','Bridge','Repeater','Modem','Bridge'),('QUES065','Which of the following condition is used to transmit two packets over a medium at the same time?','Contention','Collision','Synchronous','Asynchronous','Collision'),('QUES066','You have a class A network address 10.0.0.0 with 40 subnets, but are required to add 60 new subnets very soon. You would like to still allow for the largest possible number of host IDs per subnet. Which subnet mask should you assign?','255.240.0.0','255.248.0.0','255.252.0.0','255.254.0.0','255.254.0.0'),('QUES067','What are the most commonly used transmission speeds in BPS used in data communication?','300','1200','2400','9600','9600'),('QUES068','What is the default subnet mask for a class C network?','127.0.0.1','255.0.0.0','255.255.0.0','255.255.255.0','255.255.255.0'),('QUES069','Your company has a LAN in its downtown office and has now set up a LAN in the manufacturing plant in the suburbs. To enable everyone to share data and resources between the two LANs, what type of device(s) are needed to connect them? Choose the most correct answer','Modem','Cable','Hub','Router','Router'),('QUES070','The term DUPLEX refers to the ability of the data receiving stations to echo back a confirming message to the sender. In full duplex data transmission, both the sender and the receiver','cannot talk at once','can receive and send data simultaneously','can send or receive data one at a time','can do one way data transmission only','can receive and send data simultaneously'),('QUES071','The part of machine level instruction, which tells the central processor what has to be done, is','Operation code','Address','Locator','Flip-Flop','Operation code'),('QUES072','Which of the following refers to the associative memory?','the address of the data is generated by the CPU','the address of the data is supplied by the users','there is no need for an address i.e. the data is used as an address','the data are accessed sequentially','there is no need for an address i.e. the data is used as an address'),('QUES073','A system program that combines the separately compiled modules of a program into a form suitable for execution','assembler','linking loader','cross compiler','load and go','linking loader'),('QUES074','The Memory Buffer Register (MBR)','is a hardware memory device which denotes the location of the current instruction being executed','is a group of electrical circuits (hardware), that performs the intent of instructions fetched from memory','contains the address of the memory location that is to be read from or stored into','contains a copy of the designated memory location specified by the MAR after a READ or the new contents of the memory prior to a WRITE','contains a copy of the designated memory location specified by the MAR after a READ or the new contents of the memory prior to a WRITE'),('QUES075','Which of the following systems software does the job of merging the records from two files into one?','Security software','Utility program','Networking software','Documentation system','Utility program'),('QUES076','Which of the following instruction steps, would be written within the diamond-shaped box, of a flowchart?','S = B - C','IS A<10','PRINT A','DATA X,4Z','IS A<10'),('QUES077','Which of the following functions is(are) performed by the loader','allocate space in memory for the programs and resolve symbolic references between object decks','adjust all address dependent locations, such as address constants, to correspond to the allocated space','physically place the machine instructions and data into memory','All of the above','All of the above'),('QUES078','Which of the following addressing modes, facilitates access to an operand whose location is defined relative to the beginning of the data structure in which it appears?','ascending','sorting','index','indirect','index'),('QUES079','While running DOS on a PC, which command would be used to duplicate the entire diskette?','COPY','DISKCOPY','CHKDSK','TYPE','DISKCOPY'),('QUES080','A system program that sets up an executable program in main memory ready for execution is','assembler','linker','loader','compiler','loader'),('QUES081','Which of the following are loaded into main memory when the computer is booted?','internal command instructions','external command instructions','utility programs','None of the above','internal command instructions'),('QUES082','Which command of MS-DOS is used to copy only files that have been modified on or after the date you specify?','XCOPY/D : date','COPY/D : date','COPY/M','XCOPY/V','XCOPY/D : date'),('QUES083','While working with MS-DOS, which command is used to restore files that were backed up using the BACKUP command?','COPY','DISKCOPY','RESTORE','STORE','RESTORE'),('QUES084','What protocol is used between E-Mail servers?','FTP','SMTP','SNMP','POP3','SMTP'),('QUES085','If you configure the TCP/IP address and other TCP/IP parameters manually, you can always verify the configuration through which of the following? Select the best answer.','Network Properties dialog box','Server Services dialog box','DHCPINFO command-line utility','Advanced Properties tab of TCP/ IP Info','Network Properties dialog box'),('QUES086','In a PC to telephone hookup for long distance communication, modem is connected between the telephone line and','synchronous port','crossover cable','asynchronous port','None of the above','asynchronous port'),('QUES087','Which of the following communications service provides message preparation and transmission facilities?','Teletex','Teletext','x400','Fax','Teletex'),('QUES088','Four bits are used for packet sequence numbering in a sliding window protocol used in a computer network. What is the maximum window size?','4','8','15','16','15'),('QUES089','Linda is in charge of a small network and wants to make it simple but secure. The users want to have full control over their data and still be able to share data with the rest of the office. The networking knowledge of the office staff is basic. Which network(s) would be the best for linda to set up?','Peer-to-peer','WAN','Server-based','Share-level','WAN'),('QUES090','Error control is needed at the transport layer because of potential errors occurring _____','from transmission line noise','in routers','from out-of-sequence delivery','from packet losses','in routers'),('QUES091','The transport layer protocol is connectionless','NVT','FTP','TCP','UDP','UDP'),('QUES092','The fundamental requirements of private-to-public network interconnection methods which need to be provided in gateways is/are','universal accessibility for private network Data Terminal Equipment (DTE)','adequate cost control mechanisms for administration of the private networks','to assign address to private network DTEs','a and b both','a and b both'),('QUES093','Data link layer retransmits the damaged frames in most networks. If the probability of a frame\'s being damaged is p, what is the mean number of transmissions required to send a frame if acknowledgements are never lost','P I (K + 1)','KIK (1 + F)','1/ (1 - F)','K I (K - P)','1/ (1 - F)'),('QUES094','You are trying to decide which type of network you will use at your office, and you want the type that will provide communication and avoid collisions on the cable. Which of the following is the best choice?','CSMA/CA','Token-Ring','CSMA/CD','Ethernet','Token-Ring'),('QUES095','Interconnected networks need communication processors such as switches, routers, hubs, and gateways. Select the best fit for answer:','TCP/IP','Protocol','Open Systems','Internetwork processor','Internetwork processor'),('QUES096','Which of the following languages is more suited to a structured program?','PL/1','FORTRAN','BASIC','PASCAL','PASCAL'),('QUES097','The brain of any computer system is','ALU','Memory','CPU','Control unit','CPU'),('QUES098','The tracks on a disk which can be accessed without repositioning the R/W heads is','Surface','Cylinder','Cluster','All of the above','Cylinder'),('QUES099','A section of code to which control is transferred when a processor is interrupted is known as','M','SVC','IP','MDR','M'),('QUES100','Which part interprets program instructions and initiate control operations.','Input','Storage unit','Logic unit','Control unit','Control unit');
